import { TextField } from "@mui/material";
import axios from "axios";
import { useEffect, useState } from "react";
import Table from "./Table";
import "./main.css";

const HomePage = () => {
  return (
    <div
      style={{
        height: "100vh",
        width: "100%",
        background: "gray",
        display: "flex",
        flexDirection: "column",
      }}
    >
      <div style={{ flex: 2, display: "flex" }}>
        <div style={{ flex: 6, display: "flex", color: "white" }}>
          <div
            style={{
              flex: 3.33,
              display: "flex",
              flexDirection: "column",
              justifyContent: "center",
              alignItems: "center",
              gap: 5,
            }}
          >
            <h3>BUYING AMOUNT</h3>
            <div
              style={{
                height: "40%",
                width: "40%",
                border: "1px solid black",
                display: "flex",
                alignItem: "center",
                justifyContent: "center",
              }}
            ></div>
          </div>
          <div
            style={{
              flex: 3.33,
              display: "flex",
              flexDirection: "column",
              justifyContent: "center",
              alignItems: "center",
              gap: 5,
            }}
          >
            <h3>SELLING AMOUNR</h3>
            <div
              style={{
                height: "40%",
                width: "40%",
                border: "1px solid black",
                display: "flex",
                alignItem: "center",
                justifyContent: "center",
              }}
            ></div>
          </div>
          <div
            style={{
              flex: 3.33,
              display: "flex",
              flexDirection: "column",
              justifyContent: "center",
              alignItems: "center",
              gap: 5,
            }}
          >
            <h3>TOTAL PROFIT</h3>
            <div
              style={{
                height: "40%",
                width: "40%",
                border: "1px solid black",
                display: "flex",
                alignItem: "center",
                justifyContent: "center",
              }}
            ></div>
          </div>
        </div>
        <div
          style={{
            flex: 4,
            display: "flex",
            alignItems: "center",
            justifyContent: "center",
          }}
        >
          <div
            style={{
              height: "80%",
              width: "80%",
              display: "flex",
              alignItems: "center",
              justifyContent: "center",
            }}
          >
            <TextField
              style={{
                color: "white",
                background: "white",
              }}
              placeholder="Search..."
              type="search"
            />
          </div>
        </div>
      </div>
      <div
        style={{
          flex: 8,
          background: "red",
          display: "flex",
          alignItems: "center",
          justifyContent: "center",
        }}
      >
        <div
          style={{
            height: "99%",
            width: "99%",
            background: "white",
            display: "flex",
            flexDirection: "column",
          }}
        >
          <div
            style={{
              flex: 1,
              width: "100%",
              background: "skyblue",
              display: "flex",
            }}
          >
            <h4 style={{ flex: 1.4, marginLeft: 5 }}>BUYING PRICE</h4>
            <h4 style={{ flex: 1.4, marginLeft: 5 }}>BUYING QUANTITY</h4>
            <h4 style={{ flex: 1.4, marginLeft: 5 }}>BUYING AMOUNT</h4>
            <h4 style={{ flex: 1.4, marginLeft: 5 }}>SELLING AMOUNT</h4>
            <h4 style={{ flex: 1.4, marginLeft: 5 }}>SELLING QUANTITY</h4>
            <h4 style={{ flex: 1.4, marginLeft: 5 }}>CURRENCY</h4>
            <h4 style={{ flex: 1.4, marginLeft: 5 }}>INSERT DATE</h4>
          </div>
          <div
            style={{
              flex: 9,
              width: "100%",
            }}
          ></div>
        </div>
      </div>
    </div>
  );
};

export default HomePage;
